selector_to_html = {"a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes de volumen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Escanea el c\u00f3digo de configuraci\u00f3n correspondiente para activar o desactivar el indicador de sonido del esc\u00e1ner</p>", "a[href=\"bluetooth.html#bluetooth-spp\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth SPP<a class=\"headerlink\" href=\"#bluetooth-spp\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#bluetooth-keyboard-transmission-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidad de transmisi\u00f3n del teclado Bluetooth<a class=\"headerlink\" href=\"#bluetooth-keyboard-transmission-speed\" title=\"Link to this heading\">#</a></h2><h3>Alta velocidad<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#network-configuration\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n de red<a class=\"headerlink\" href=\"#network-configuration\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de transmisi\u00f3n Wi-Fi<a class=\"headerlink\" href=\"#wi-fi-transmission-mode\" title=\"Link to this heading\">#</a></h1><h2>Modificar ID del dispositivo<a class=\"headerlink\" href=\"#modify-device-id\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de almacenamiento<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Carga de datos<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo Bluetooth<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1><h2>HID Bluetooth<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtener versi\u00f3n de Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-4-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 4:\u00bfEscanear con \u00e9xito, los datos subidos son incorrectos?<a class=\"headerlink\" href=\"#question-4-scan-successful-uploaded-data-incorrect\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong></p>", "a[href=\"bluetooth.html#modify-bluetooth-name\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modificar nombre Bluetooth<a class=\"headerlink\" href=\"#modify-bluetooth-name\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#ds2800-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Gu\u00eda de configuraci\u00f3n r\u00e1pida del esc\u00e1ner inal\u00e1mbrico <strong>DS2800</strong><a class=\"headerlink\" href=\"#ds2800-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tiempo de sue\u00f1o<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>Escaneando el siguiente c\u00f3digo de configuraci\u00f3n, puede establecer el esc\u00e1ner para entrar en modo de sue\u00f1o despu\u00e9s de un cierto per\u00edodo de tiempo en el que no se escanea ning\u00fan c\u00f3digo, para reducir el consumo de energ\u00eda.</p>", "a[href=\"bluetooth.html#bluetooth-ble\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth BLE<a class=\"headerlink\" href=\"#bluetooth-ble\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de trabajo<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>En el \u00e1rea de trabajo fuera del rango de los 2. G receptor o se\u00f1al Bluetooth, puede activar el modo de almacenamiento del esc\u00e1ner siguiendo los pasos descritos a continuaci\u00f3n. En este modo, todos los datos escaneados ser\u00e1n almacenados directamente en el esc\u00e1ner. Antes de subir los datos se guardar\u00e1 permanentemente en el esc\u00e1ner para que puedas subir los datos cuando el esc\u00e1ner est\u00e9 en el rango de se\u00f1al que recibe.</p>", "a[href=\"faq.html#question-3-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 3:El esc\u00e1ner muestra cinco veces cuando se presiona un bot\u00f3n. \u00bfC\u00f3mo puedo resolver este problema?<a class=\"headerlink\" href=\"#question-3-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> La bater\u00eda es baja y necesita ser cargada antes de poder volver a usarla.</p>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Informaci\u00f3n de la bater\u00eda<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#bluetooth-hid\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">HID Bluetooth<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#modify-device-id\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modificar ID del dispositivo<a class=\"headerlink\" href=\"#modify-device-id\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#ios-popup-hide-keyboard\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">IOS Popup/Ocultar Teclado<a class=\"headerlink\" href=\"#ios-popup-hide-keyboard\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 1: El escaneo es exitoso, el zumbido suena una vez, pero no se cargan datos?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> El esc\u00e1ner ha entrado en modo de almacenamiento y necesita escanear <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modo Normal</span></a> para recuperar.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Idioma del teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Obtener idioma actual del teclado<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">FAQ<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h1><h2>Pregunta 1: El escaneo es exitoso, el zumbido suena una vez, pero no se cargan datos?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> El esc\u00e1ner ha entrado en modo de almacenamiento y necesita escanear <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modo Normal</span></a> para recuperar.</p>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"wireless.html#data-rceiving-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato de datos<a class=\"headerlink\" href=\"#data-rceiving-format\" title=\"Link to this heading\">#</a></h2><h3>C\u00f3digo de voz<a class=\"headerlink\" href=\"#voice-code\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n del Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#clear-pairing-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Borrar informaci\u00f3n de emparejamiento<a class=\"headerlink\" href=\"#clear-pairing-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#data-transmission-protocol\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Protocolo de transmisi\u00f3n de datos<a class=\"headerlink\" href=\"#data-transmission-protocol\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 2:El esc\u00e1ner escanea con \u00e9xito, pega dos veces, y puede subir datos normalmente. \u00bfQu\u00e9 est\u00e1 pasando?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> La bater\u00eda de la pistola del esc\u00e1ner es baja y le indica que necesita ser recargada.</p>", "a[href=\"wireless.html#data-upload-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato de subida de datos<a class=\"headerlink\" href=\"#data-upload-format\" title=\"Link to this heading\">#</a></h2><h3>Contenido de c\u00f3digo de barras original<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#original-barcode-content1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del teclado<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Configuraci\u00f3n del Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
